(function(){"use strict";const o=new WebSocket("ws://localhost/ws/it");o.onopen=e=>{console.log("A Connection to the I.T Channel is complete.")},o.onmessage=e=>{let s=JSON.parse(e.data);switch(s.type){case"WS_MESSAGE":postMessage({type:"it_channel_message",payload:s.message.trim()});break;case"WS_CONNECTION_NEWUSER":console.log("Got NEW USER joined channel message!");break;case"WS_DISCONNECTED_USER":console.log("Got USER DISCONNECTED message! (update online count)");break;case"WS_CONNECTION_SUCCESS":console.log("Got USER CONNECTION successful (get socket-id and update online count)!");break;default:console.log(`Got an untyped Message on Websocket Channel.${e.data}`);break}},onmessage=e=>{console.log(`Web Worker Got Message of: ${e} from main-thread`)}})();
